import React from 'react';
import { FaBriefcase, FaGraduationCap, FaHome, FaUser } from 'react-icons/fa';
import './Style.css';

function NavigationItems({ setNavSelected }) {

    const getClickeditem = e => {
        if (e.target.dataset.item !== undefined) {
            setNavSelected(e.target.dataset.item);
        }
    }

    return (
        <ul className="navigation" id="nav_items">
            <li data-item="home"      onClick={getClickeditem.bind(this)}><FaHome onClick={getClickeditem.bind(this)} size={32} data-item="home" color={"#2c4269"}/></li>
            <li data-item="aboutme"   onClick={getClickeditem.bind(this)}><FaUser          size={32} data-item="aboutme" color={"#2c4269"}/></li>
            <li data-item="education" onClick={getClickeditem.bind(this)}><FaGraduationCap size={32} data-item="education" color={"#2c4269"}/></li>
            <li data-item="work"      onClick={getClickeditem.bind(this)}><FaBriefcase     size={32} data-item="work" color={"#2c4269"}/></li>
        </ul>   
    );
}

export default NavigationItems;
